import { Filter } from "./Filter"

export const MenuFilter = () => {

    let dataType = ["salati", "kartofeni-vkusotiiki", "bezmesni", "pileshka-skara", "svinska-skara", "pileshki-mezeta", "svinski-mezeta", "pileshki-qstiq", "svinski-qstiq", "sachove", "spageti", "rizoto", "garnituri", "pitkit", "mezeta", "deserti"];
    let names = ["салати", "картофени вкусотийки", "безмесни", "пилешка скара", "свинска скара", "пилешки мезета", "свински мезета", "пилешки ястия", "свински ястия", "сачове", "спагети", "ризото", "гарнитури", "питки", "мезета", "десерти"];

some =[
    {en:'salati',
    bg:''
    }
]



    return (
        <div className='menuFilter'>
            <ul>
                {dataType.map(x => <Filter data={x} name={names}/>)}
            </ul>
        </div>
    )
}
